import React from 'react';

export const KeyResults = () => {
    return <>
        <h4>Day's Key Result expectations and outcome here</h4>
        <input type="text" name="keyresultsexpected" defaultValue="key results to be replaces with a small table of actions for today"></input>
        <input type="text" name="highlight" defaultValue="highlight of the day"></input>
        <input type="text" name="learnt" defaultValue="what did you learn today"></input>
    </>;
};
